    false,nt"url": null,nt"notes": "The Fallon, Stillwater and Anaho Island
    National Wildlife Refuges are located in northwest Nevada and are administered by
    the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
    Wildlife Management Area (SWMA). The weather in 1976 was unusual during the summer
    months in that rain storms were frequent. Drought conditions reduced wetlands to
    4,700 acres by the end of December 31. Grazing by cattle and horses continued over
    the entire Area. Overgrazing remains an issue as habitat for ducks, marsh and shorebirds
    became depleted. Waterfowl use days for CY 1976 were down 53% from CY 1975. Waterfowl
    hunting visits were down 56% from the u201975-u201976 hunting season. Drought conditions
    sent many hunters to the Humboldt Sink which had much better water and hunting conditions.
    Vandalism and other illegal activities continue to be a severe problem and are difficult
    to patrol with only two personnel.  The monitoring program of Lahontan Valley wetlands
    continued through the fifth year. The primary purpose of the study is to determine
    the effect of reduced irrigation water on fish, wildlife and water oriented recreation.",nt"license_title":
